class AnimatedBorderFrame(QFrame):
    def __init__(self, parent=None):
        super().__init__(parent)
        self._hue = 180
        self.setMinimumSize(400, 300)
        timer = QTimer(self)
        timer.timeout.connect(lambda: (setattr(self, '_hue', (self._hue + 2) % 360), self.update()))
        timer.start(30)
        
    def paintEvent(self, event):
        super().paintEvent(event)
        p = QPainter(self)
        p.setRenderHint(QPainter.RenderHint.Antialiasing)
        g = QLinearGradient(0, 0, self.width(), self.height())
        g.setColorAt(0, QColor.fromHsv(self._hue, 200, 255))
        g.setColorAt(0.5, QColor.fromHsv((self._hue + 60) % 360, 200, 255))
        g.setColorAt(1, QColor.fromHsv((self._hue + 120) % 360, 200, 255))
        p.setPen(QPen(g, 3))
        p.drawRoundedRect(1, 1, self.width() - 2, self.height() - 2, 10, 10)

