class InfoBox(QLabel):
    def __init__(self, text, box_type="info"):
        super().__init__(text)
        self.setWordWrap(True)
        
        if box_type == "warning":
            style = """
                background:rgba(255,165,0,0.15);
                border:2px solid #ffa500;
                border-left:5px solid #ffa500;
                color:#ffa500;
            """
        else:
            style = """
                background:rgba(0,217,255,0.15);
                border:2px solid #00d9ff;
                border-left:5px solid #00d9ff;
                color:#00d9ff;
            """
        
        self.setStyleSheet(style + "border-radius:8px;padding:12px;font-size:10pt;line-height:1.5")


class AnimatedWave(QWidget):
    def __init__(self, parent=None):
        super().__init__(parent)
        self.setFixedHeight(3)
        self.offset = 0
        self.timer = QTimer(self)
        self.timer.timeout.connect(self.animate)
        self.timer.start(30)  # 30fps
    
    def animate(self):
        self.offset = (self.offset + 2) % 360
        self.update()
    
    def paintEvent(self, event):
        painter = QPainter(self)
        painter.setRenderHint(QPainter.RenderHint.Antialiasing)
        
        width = self.width()
        height = self.height()
        
        # Create gradient that shifts
        for x in range(width):
            # Calculate hue based on position and animation offset
            hue = int((x / width * 360 + self.offset) % 360)
            color = QColor.fromHsv(hue, 200, 255)
            
            # Calculate wave height
            wave_y = height / 2 + (height / 4) * ((x / 30 + self.offset / 20) % 2 - 1)
            
            painter.setPen(QPen(color, 2))
            if x > 0:
                prev_wave_y = height / 2 + (height / 4) * (((x-1) / 30 + self.offset / 20) % 2 - 1)
                painter.drawLine(x-1, int(prev_wave_y), x, int(wave_y))


